import React from "react";
const ParkPics = props => (
      <div className = "park__pics">
      {
        props.name && <p className = "park__key">Park Name: <span>{props.name}</span></p>
      }
      {
        props.image && <p className = "park__pic"> <span>{props.image}</span></p>
      }
      </div>
);
export default ParkPics;
